Rules.InvariantScript:
UpdateContext({var_UpperBack: !var_UpperBack});
If(
    var_UpperBack,
    Collect(
        col_BodyPart,
        "Upper back"
    )
);
If(
    !var_UpperBack,
    RemoveIf(
        col_BodyPart,
        Value = "Upper back"
    )
)

UpdateContext({var_LeftKnee: !var_LeftKnee});
If(
    var_LeftKnee,
    Collect(
        col_BodyPart,
        "Left knee"
    )
);
If(
    !var_LeftKnee,
    RemoveIf(
        col_BodyPart,
        Value = "Left knee"
    )
)
